# the usual stuff [dependencies]
{% if crate_type == "bin" %}
structopt = "0.3.21"
{% endif %}
# other general dependencies {% if crate_type == "bin" %}
[[bin]]
path = "src/main.rs"
name = "{{crate_name}}-cli"
{% endif %} Now a user of this template could decide weather they want the binary version by passing --bin or use only the library version by passing --lib as a command line argument.

